import React from 'react'
import '../Pokemon/Pokemon.css'
const Pokemon = ({posts, loading}) => {
   
    if (loading) {
        return <h2>Loading...</h2>;
      }
    
      return (
        <div>
            {
                posts && posts.map(p=>(
                    <div>
                        <h1>{p.name}</h1> 
                        <img src={p.sprite} alt="" />  
                    </div>
                    

                ))
            }
        </div>
      );
    };


export default Pokemon
